import { useNavigate, useLocation } from "react-router-dom";

export const MemeGenerated = () => {
    
    const history = useNavigate();
    const location = useLocation();
    const url = new URLSearchParams(location.search).get('url');

    return(
        <div>
            { url && <img src={url} /> }
        </div>
    );
};
